import React, {useEffect, useState} from 'react'
import Backdrop from '@mui/material/Backdrop';
import CircularProgress from '@mui/material/CircularProgress';
import msftinitialdata from '../static/msftinitialdata.png'
import msftvsdata from '../static/msftvsdata.png'


const Predictions = () => {
    const [data, setData] = useState([])

    const getData = async () =>{
        if(data.length === 0){
            const response  = await fetch(`http://127.0.0.1:5000/api/microsoft`);
            setData(await response.json());
            console.log(data);
        }
    }

    useEffect(()=> {
        getData();
    }, [getData]);

  return (
    <>
        <div className="google-value">
            <div className="predicted_price">
                <div className="predicted_price_header">MSFT Predicted Price</div>
                <img src={msftinitialdata} alt="msft"/>
                <div className="value">{data?.msftlstmdata ? data?.msftlstmdata : <Backdrop
                    sx={{ color: '#fff', zIndex: (theme) => theme.zIndex.drawer + 1 }}
                    open>
                    <CircularProgress color="inherit" />
                    </Backdrop>}
                </div>
                <img src={msftvsdata} alt="msft"/>
            </div>
        </div>
    </>
  )
}

export default Predictions
